import React, { useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import campo1 from './src\pages\Cadastro\campo1.js';
import campo2 from './CampoDeEntrada2';
import campo3 from './CampoDeEntrada3';

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="CampoDeEntrada1">
        <Stack.Screen name="CampoDeEntrada1" component={CampoDeEntrada1} />
        <Stack.Screen name="CampoDeEntrada2" component={CampoDeEntrada2} />
        <Stack.Screen name="CampoDeEntrada3" component={CampoDeEntrada3} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
